import React, { useState } from 'react';
import './Tracker.css';

const Tracker: React.FC = () => {
  const [steps, setSteps] = useState('');
  const [calories, setCalories] = useState('');
  const [water, setWater] = useState('');
  const [workout, setWorkout] = useState('');
  const [height, setHeight] = useState('');
  const [weight, setWeight] = useState('');
  const [heartRate, setHeartRate] = useState('');
  const [sleep, setSleep] = useState('');
  const [stride, setStride] = useState('');

  // State to store confirmed values
  const [confirmed, setConfirmed] = useState<null | {
    steps: string;
    stride: string;
    calories: string;
    water: string;
    workout: string;
    height: string;
    weight: string;
    heartRate: string;
    sleep: string;
    bmi: string;
    distance: string;
  }>(null);

  const bmi =
    height && weight
      ? (parseFloat(weight) / ((parseFloat(height) / 100) ** 2)).toFixed(2)
      : '';

  const distance =
    steps && stride
      ? ((parseFloat(steps) * parseFloat(stride)) / 100000).toFixed(2)
      : '';

  const handleConfirm = () => {
    setConfirmed({
      steps,
      stride,
      calories,
      water,
      workout,
      height,
      weight,
      heartRate,
      sleep,
      bmi: bmi || '0',
      distance: distance || '0',
    });
  };

  return (
    <div className="tracker">
      <h2>Fitness Tracker</h2>
      <label>
        Steps:
        <input
          type="number"
          value={steps === '' ? undefined : steps}
          onChange={e => setSteps(e.target.value)}
          placeholder="Enter steps"
        />
      </label>
      <label>
        Stride Length (cm):
        <input
          type="number"
          value={stride === '' ? undefined : stride}
          onChange={e => setStride(e.target.value)}
          placeholder="Enter stride length"
        />
      </label>
      <label>
        Calories:
        <input
          type="number"
          value={calories === '' ? undefined : calories}
          onChange={e => setCalories(e.target.value)}
          placeholder="Enter calories"
        />
      </label>
      <label>
        Water Intake (L):
        <input
          type="number"
          value={water === '' ? undefined : water}
          onChange={e => setWater(e.target.value)}
          placeholder="Enter water intake"
        />
      </label>
      <label>
        Workout Time (min):
        <input
          type="number"
          value={workout === '' ? undefined : workout}
          onChange={e => setWorkout(e.target.value)}
          placeholder="Enter workout time"
        />
      </label>
      <label>
        Weight (kg):
        <input
          type="number"
          value={weight === '' ? undefined : weight}
          onChange={e => setWeight(e.target.value)}
          placeholder="Enter weight"
        />
      </label>
      <label>
        Height (cm):
        <input
          type="number"
          value={height === '' ? undefined : height}
          onChange={e => setHeight(e.target.value)}
          placeholder="Enter height"
        />
      </label>
      <label>
        Heart Rate (bpm):
        <input
          type="number"
          value={heartRate === '' ? undefined : heartRate}
          onChange={e => setHeartRate(e.target.value)}
          placeholder="Enter heart rate"
        />
      </label>
      <label>
        Sleep Hours:
        <input
          type="number"
          value={sleep === '' ? undefined : sleep}
          onChange={e => setSleep(e.target.value)}
          placeholder="Enter sleep hours"
        />
      </label>
      <button onClick={handleConfirm} style={{ marginTop: '1rem' }}>
        Confirm
      </button>
      <div>
        <p>Total Steps: {steps || 0}</p>
        <p>Distance: {distance ? `${distance} km` : '0 km'}</p>
        <p>Total Calories: {calories || 0}</p>
        <p>Water Intake: {water || 0} L</p>
        <p>Workout Time: {workout || 0} min</p>
        <p>Weight: {weight || 0} kg</p>
        <p>Height: {height || 0} cm</p>
        <p>BMI: {bmi || 0}</p>
        <p>Heart Rate: {heartRate || 0} bpm</p>
        <p>Sleep Hours: {sleep || 0}</p>
      </div>
      {confirmed && (
        <div style={{ marginTop: '2rem', borderTop: '1px solid #ccc', paddingTop: '1rem' }}>
          <h3>Confirmed Data</h3>
          <p>Steps: {confirmed.steps || 0}</p>
          <p>Stride Length: {confirmed.stride || 0} cm</p>
          <p>Calories: {confirmed.calories || 0}</p>
          <p>Water Intake: {confirmed.water || 0} L</p>
          <p>Workout Time: {confirmed.workout || 0} min</p>
          <p>Weight: {confirmed.weight || 0} kg</p>
          <p>Height: {confirmed.height || 0} cm</p>
          <p>BMI: {confirmed.bmi || 0}</p>
          <p>Distance: {confirmed.distance || 0} km</p>
          <p>Heart Rate: {confirmed.heartRate || 0} bpm</p>
          <p>Sleep Hours: {confirmed.sleep || 0}</p>
        </div>
      )}
    </div>
  );
};

export default Tracker;
